tables.table_schema:
CREATE TABLE Machine_Learning_Models (
    model_id INT PRIMARY KEY,
    model_name VARCHAR(255),
    model_type VARCHAR(50),
    model_accuracy FLOAT
);
CREATE TABLE Model_Results (
    result_id INT PRIMARY KEY,
    model_id INT,
    result_metric VARCHAR(30),
    result_value FLOAT,
    FOREIGN KEY (model_id) REFERENCES Machine_Learning_Models(model_id)
);

CREATE TABLE model_inputs (
    id SERIAL PRIMARY KEY,
    input_name VARCHAR(255) NOT NULL,
    input_data JSONB NOT NULL
);

CREATE TABLE model_outputs (
    id SERIAL PRIMARY KEY,
    output_name VARCHAR(255) NOT NULL,
    output_data JSONB NOT NULL
);

CREATE TABLE model_metadata (
    id SERIAL PRIMARY KEY,
    model_name VARCHAR(255) NOT NULL,
    model_description TEXT
);

CREATE TABLE machine_learning_models (
    model_id SERIAL PRIMARY KEY,
    model_name TEXT NOT NULL,
    model_type TEXT NOT NULL,
    created_at TIMESTAMPTZ DEFAULT NOW()
);

CREATE TABLE model_parameters (
    parameter_id SERIAL PRIMARY KEY,
    model_id INT REFERENCES machine_learning_models(model_id) ON DELETE CASCADE,
    parameter_name TEXT NOT NULL,
    parameter_value FLOAT NOT NULL
);

CREATE TABLE training_data (
    data_id SERIAL PRIMARY KEY,
    model_id INT REFERENCES machine_learning_models(model_id) ON DELETE CASCADE,
    feature_vector JSONB NOT NULL,
    target_variable FLOAT NOT NULL
);

CREATE TABLE predictions (
    prediction_id SERIAL PRIMARY KEY,
    model_id INT REFERENCES machine_learning_models(model_id) ON DELETE CASCADE,
    input_data JSONB NOT NULL,
    predicted_output FLOAT NOT NULL
);
